import React, { Component } from 'react';

import BaseLayout from '../components/layouts/BaseLayout';

class Index extends Component {
  render() {
    return (
      <BaseLayout>
        <h1>Welcome Page!</h1>
      </BaseLayout>
    );
  }
}

export default Index;
